INSERT INTO `fn_uploaddetails` VALUES ('3980', '62', 'Jumping over a road. This was mid-way through the Oregon Backcountry Discovery Route (ORBDR). I took the trip in September 2013. ', '2108-KLR_Air.jpg', '/images/uploads/finaoimages', '37', '2108', '241', '2013-10-26 00:18:25', '1', '241', '2013-10-26 00:18:55', 'Jumping a road on a fully loaded KLR650. ', null, null, null, null, null, null, null, null);
INSERT INTO `fn_uploaddetails` VALUES ('3981', '62', 'The last few hundred miles of the ORBDR was high desert cattle land. It was fast and fun. We had to watch out for barbed wire fences, and baby head sized rocks. ', '2108-cattle_land.jpg', '/images/uploads/finaoimages', '37', '2108', '241', '2013-10-26 00:20:48', '1', '241', '2013-10-26 00:20:48', 'Stopped in cattle land. ', null, null, null, null, null, null, null, null);
INSERT INTO `fn_uploaddetails` VALUES ('3982', '62', 'ORBDR: Speaking of cattle land, we stumbled upon this giant white cube out in the middle of no where. It is a giant salt lick. I\'m just glad the giant hamsters didn\'t attack!', '2108-Salt_Lick.jpg', '/images/uploads/finaoimages', '37', '2108', '241', '2013-10-26 00:24:17', '1', '241', '2013-10-26 00:24:17', 'Giant salt lick = Giant hamsters!', null, null, null, null, null, null, null, null);
INSERT INTO `fn_uploaddetails` VALUES ('3983', '62', 'ORBDR: Sunset at Olive Lake, Oregon. Yeah, it was a great campsite. ', '2108-Lake_Sunset_720.jpg', '/images/uploads/finaoimages', '37', '2108', '241', '2013-10-26 00:25:52', '1', '241', '2013-10-26 00:25:52', 'Olive Lake, Oregon. ', null, null, null, null, null, null, null, null);
INSERT INTO `fn_uploaddetails` VALUES ('3984', '62', 'ORBDR: We made it to the end of the trail in Lakeview Oregon. Eight days on the bikes and I think that we could have continued for another eight months. Love riding and exploring. ', '2108-TheEnd.jpg', '/images/uploads/finaoimages', '37', '2108', '241', '2013-10-26 00:28:09', '1', '241', '2013-10-26 00:28:09', 'At the end of the ORBDR', null, null, null, null, null, null, null, null);
INSERT INTO `fn_uploaddetails` VALUES ('3985', '62', 'Stayed at the Roadway Inn on the way back to Seattle, WA from Lakeview, OR.\r\nHad to capture the sunset in Bend, Oregon.  ', '2108-Bend_Sunset_720.jpg', '/images/uploads/finaoimages', '37', '2108', '241', '2013-10-26 00:29:54', '1', '241', '2013-10-26 00:29:54', 'Sunset in Bend Oregon. ', null, null, null, null, null, null, null, null);
