INSERT INTO `fn_uploaddetails` VALUES ('4319', '62', 'Damn. Mom is back in the hospital tonight. She\'s going to be okay, but her poor little body has been so out of balance with the chemo, all the medications, too much fluid, not enough fluid, etc. that it just doesn\'t know how to act. With the help of ', '', '', '37', '2040', '63', '2014-01-05 16:53:59', '1', '63', '2014-01-05 16:53:59', null, null, null, null, null, null, null, null, null);
INSERT INTO `fn_uploaddetails` VALUES ('4320', '34', 'Jo & Mom on Christmas eve.', '2040-IMG_4034.JPG', '/images/uploads/finaoimages', '37', '2040', '63', '2014-01-05 16:58:04', '1', '63', '2014-01-05 17:55:58', '', null, null, null, null, null, null, null, null);
INSERT INTO `fn_uploaddetails` VALUES ('4321', '62', 'Annie\'s back leg is still bothering her, but she seems to have adjusted. She still loves her walks but they are much shorter and slower than before. ', '', '', '37', '927', '63', '2014-01-05 17:14:02', '1', '63', '2014-01-05 17:14:02', null, null, null, null, null, null, null, null, null);
INSERT INTO `fn_uploaddetails` VALUES ('4322', '62', 'There is a very bright light at the end of this tunnel. Mom has only one more chemotherapy treatment to go. She handled her last one on Friday with her usual aplomb. She\'s still quite weak and we spoke to the doctor about a blood transfusion which mi', '', '', '37', '2040', '63', '2014-01-05 17:42:35', '1', '63', '2014-01-05 17:42:35', null, null, null, null, null, null, null, null, null);
