INSERT INTO `fn_uploaddetails` VALUES ('4328', '62', 'Her MUGA scan shows her heart is still strong and working within the normal range.  Yay!  No problems there, hence no adjustments to her chemotherapy.  Dr. Eadens says she does not need a blood transfusion.\n\nShe\'s getting a LITTLE stronger each day a', '', '', '37', '2040', '63', '2014-01-07 18:28:07', '1', '63', '2014-01-07 18:28:07', null, null, null, null, null, null, null, null, null);
