INSERT INTO `fn_uploaddetails` VALUES ('4440', '62', 'We officially booked our 5 day 4 night trek in the Amazon for the first part of our trip in Peru! I\'m so excited - it\'s going to be such an adventure. We booked with a local who grew up in the area and now runs tours through the Jungle, starting from his home town Iquitos. Here\'s the link to one of his sites...which includes some really cool pictures of things we will be experiencing! http://www.leaplocal.org/locals/view/303/ ', '', '', '37', '3039', '435', '2014-01-20 11:32:18', '1', '435', '2014-01-20 11:32:18', null, null, null, null, null, null, null, null, null);
INSERT INTO `fn_uploaddetails` VALUES ('4441', '62', 'Along with our Amazon excursion, we also booked out Inca Trail multi-day hike up to Machu Picchu! We had to book so far in advance because only 500 people can enter the hike on the Inca Trail each day. That only leaves room for about 200 tourists since there are more tour guides and porters. The longest hike I\'ve ever done was only a day hike, probably a few hours or so. We will have to spend a couple of days at the base of the mountain in Cusco to get acclimated to the elevation. If we don\'t, we run the risk of getting altitude sickness. One of the perks of hiking the trail to MP is we will be the first on the mountain in the morning and won\'t have to share with hundreds of other tourists. It will be a very special opportunity! ', '', '', '37', '3038', '435', '2014-01-20 11:40:42', '1', '435', '2014-01-20 11:40:42', null, null, null, null, null, null, null, null, null);
INSERT INTO `fn_uploaddetails` VALUES ('4442', '62', 'I just returned from completing my second of three Jostens Academy training courses! Before I created this FINAO, I had already attended and graduated from the Presentation Academy three days into working at Jostens. \n\nProspecting Academy was challenging, but I felt as though the tools and connections I built there were worth the work! I wanted to make the most of this week long training and prepared hard for it knowing the takeaway would be incredibly valuable to what I bring into this business. My effort paid off and I was selected as a top three finisher in my class - chosen by the Sr. Reps, Regional Managers and training instructors. We then had to \"present\" or role-play prospect to a principal in front of the class to try and earn class valedictorian. I was up against two reps and was the only associate selected, so I am very proud of my accomplishments!\n\nI have one academy left to complete. Technology Academy unfortunately was schedule after we booked our trip to Peru and conflicts with that. It starts July 27th and I get back from Peru July 29th. I will have to see if we can possibly make an adjustment to our trip so I can attend. Otherwise, I will have to plan for it next year! ', '', '', '37', '3082', '435', '2014-01-20 11:54:47', '1', '435', '2014-01-20 11:54:47', null, null, null, null, null, null, null, null, null);
