INSERT INTO `fn_uploaddetails` VALUES ('4449', '62', 'Every day of 2014, I will:\n-Do 100 pushups\n-Do 100 situps\n-Drink 50 oz of water\n-Spend at least 10 minutes doing dynamic stretches\n-Find time to do other simple exercises\n\nEvery week, I will:\n-Go to three Karate classes\n-Go to at least one Jujutsu class\n-Get at least one total hour of cardiovascular fitness\n\nEach month, I will:\n-Go hiking at least twice\n-Learn new ways to get exercise\n\nBy the end of 2014, I will:\n-Have biked more than 1,000 total miles\n-Done more than 36,500 pushups and 36,500 situps\n-Earned a blue belt in Karate\n-Earned a belt in Jujutsu\n-Changed my lifestyle to make more time and priority for physical health', '', '', '37', '3248', '706', '2014-01-21 18:44:53', '1', '706', '2014-01-21 18:47:39', null, null, null, null, null, null, null, null, null);
