INSERT INTO `fn_user_finao_journal` VALUES ('214', '627', 'I am currently doing a series of online \"Aspiring Youth Speaker\" trainings. My ultimate goal is to build a solid group of 3-5 speakers that I can invest my knowledge and expertise into. This will expand the positive impact we can all make. Next step is to upload last week\'s training that was hindered by wifi connection in Arizona.', '1', '2013-06-22 15:04:25', null, '255', null, '255', '2013-06-22 15:04:25', '255', '2013-06-22 15:04:25', null);
INSERT INTO `fn_user_finao_journal` VALUES ('215', '630', 'I am about 1/3 done with my 3rd book entitled \"From Me to We.\" This is a collaboration I am doing with Dr. Raphael Travis at Texas State University. This has been a challenging book since my brain got burned out from speaking and trying to refinance my condo. I have forced myself to go to writing groups in which they make help you write in an atmosphere that is strictly for writing.', '1', '2013-06-22 15:25:02', null, '255', null, '255', '2013-06-22 15:25:02', '255', '2013-06-22 15:25:02', null);
INSERT INTO `fn_user_finao_journal` VALUES ('216', '631', 'I took 11 months off from dating to really focus on myself. I really dug into some very deep co-dependency issues I had from a longterm relationship that went south several years ago. I am not out to change other people and I am not about to change who I am for someone. I have had good and \"challenging\" relationships in the past. I am more comfortable being who I am now, I don\'t allow \"rose colored glasses\" to blind me from red flags in a relationship. I am intentional in my approach and respect myself enough to go for what I really desire :)', '1', '2013-06-22 15:33:02', null, '255', null, '255', '2013-06-22 15:33:02', '255', '2013-06-22 15:33:02', null);
INSERT INTO `fn_user_finao_journal` VALUES ('217', '633', 'I just purchased a 2013 Dodge Dart SXT! I have been waiting for Shark Fin accessory to come out! July 1st!! I will reward myself with this sweet fin after my next speaking engagement booking :)', '1', '2013-06-22 15:39:19', null, '255', null, '255', '2013-06-22 15:39:19', '255', '2013-06-22 15:39:19', null);
