INSERT INTO `fn_user_finao_journal` VALUES ('279', '915', '7/7/2013 \nI sometimes feel so frustrated. I wish I could go back to 9th grade and start all over. I wish I had surrounded myself with people who would have had a positive influence on my life. Even though I didn\'t fall into any peer pressure, I feel upset about being around such negative people. If not all but so many of the people I know aren\'t going to college, had baby\'s at a young age, go in and out of jail and mostly aren\'t where I want to be in my life. Today has been especially hard for me because on summer days I want to be able to hang out with friends. But allowing myself to go back into that place, I just can\'t. ', '1', '2013-07-07 21:54:26', null, '127', null, '127', '2013-07-07 21:54:26', '127', '2013-07-07 21:54:26', null);
INSERT INTO `fn_user_finao_journal` VALUES ('280', '277', 'Lately I have been texting and driving. Even if I feel that its important at that moment. I let the text wait until I\'m done driving! Feeling accomplished. :)', '2', '2013-07-07 21:58:42', null, '127', null, '127', '2013-07-07 21:58:42', '127', '2013-07-07 21:59:09', null);
INSERT INTO `fn_user_finao_journal` VALUES ('281', '916', 'Took a class where he \"moon walked\" along before putting pedals on. He\'s getting it, but not quite there yet.', '1', '2013-07-07 22:09:24', null, '270', null, '270', '2013-07-07 22:09:24', '270', '2013-07-07 22:09:24', null);
INSERT INTO `fn_user_finao_journal` VALUES ('282', '914', 'I decided to take the rear tire off myself.  My neighbor Jim came over for about 45 minutes, and we almost got it off.  It was getting late, so I decided to go to bed.', '2', '2013-07-07 22:16:12', null, '199', null, '199', '2013-07-07 22:16:12', '199', '2013-07-07 22:16:12', null);
