INSERT INTO `fn_user_finao_journal` VALUES ('390', '1236', 'I want to get married and have kids but before I have that experience I want to be perfectly satisfied being single and happy to be in my own presence.', '1', '2013-07-28 15:50:07', null, '333', null, '333', '2013-07-28 15:50:07', '333', '2013-07-28 15:50:07', null);
INSERT INTO `fn_user_finao_journal` VALUES ('391', '1237', 'I travel and speak and have way to many things on my to do list.  I want to just learn how to be.  I love to exercise, meditate and be outdoors near water or mountains.  All of these habits bring joy to my heart and health to my body.  I want healthy living to be a part of my health being.', '1', '2013-07-28 15:51:49', null, '333', null, '333', '2013-07-28 15:51:49', '333', '2013-07-28 15:51:49', null);
INSERT INTO `fn_user_finao_journal` VALUES ('392', '1241', 'I know I can inspire people in the workforce to bring their very best self to work everyday.  FIRED UP EMPLOYEES equal FIRED UP and happy customers.  Life would be so much better if we all gave our best service to others no matter what our job is.', '1', '2013-07-28 15:57:04', null, '333', null, '333', '2013-07-28 15:57:04', '333', '2013-07-28 15:57:04', null);
INSERT INTO `fn_user_finao_journal` VALUES ('393', '1242', '.  My HERO ON DUTY principles of HONESTY, EMPATHY, RESPONSIBILITY and OPTIMISM are good start and really get my audiences excited to step up and be HEROES in life.  I will write a HERO ON DUTY book or curriculum next.  ', '1', '2013-07-28 15:59:09', null, '333', null, '333', '2013-07-28 15:59:09', '333', '2013-07-28 15:59:09', null);
