INSERT INTO `fn_user_profile` VALUES ('28', '63', '', '', '63-440196343IMG_2371.JPG', '63-1246565373-P1000778.JPG', '0', '63', '2013-03-16 18:13:11', '63', '2013-11-15 16:51:52', 'I\'m a dad with four unique kids and a wonderful partner that inspire me regularly. I love to cook and garden, to be outdoors - hike, ski, kayak, and scuba - none of which I do as often or as well as I would like. As with all of us who live a FINAO life, I am a work in progress.  ', 'saved', '63-440196343IMG_2371.JPG', 'tempbg-63-485456954-trevorplayingsoldier.jpg', null);
