INSERT INTO `fn_user_profile` VALUES ('44', '101', '', '', '101-1769529712IMG_7921.JPG', '101-636887035-melissa_tucker_091613_0248e.jpg', '0', '101', '2013-04-09 10:08:38', '101', '2013-11-11 15:32:53', 'Melissa graduated post-secondary into fashion, majoring in marketing and worked in China in the fashion industry for almost three years before returning to Toronto over twelve years ago. Melissa returned to Toronto as a self-proclaimed ‘skinny fat girl’, meaning she fit a size 6 but was not fit! A lot has changed for Melissa in the decade since her return from overseas.\r\nMelissa’s extensive educational background in nutrition and holistic wellness, Nero linguistic Programing and cutting edge Physical Fitness Programing makes her one of the most well rounded fitness professionals in the industry. Being certified in the culinary arts also affords Melissa the opportunity to design recipes and meals that are tailored specifically to each client’s needs. Melissa is also the creative force behind the Fitlicious Flavour Blasters and supplement line; a product line that helps make food Deliciously Fit.\r\nAs a professional fitness model and competitor Melissa has used her determination to compete in fitness competitions around the world, including representing Canada in Spain at the IFBB World Championships in 2005. She later became a national fitness competition judge. Melissa’s radio show, Get Fitlicious with Melissa Tucker, and Celebrity Trainer TV has given her the opportunity to meet with fans and fitness enthusiasts alike to develop a truly Fitlicious lifestyle.\r\nMelissa’s passion for working out while traveling inspired her to develop and launch her Portable Personal Trainer App bringing her Fitlicious inspired lifestyle right to her client’s personal computer or hand held mobile device expanded her coaching to an international client reach.\r\nSo what’s next for Melissa?  She will be sharing her energy and expertise to global corporate audiences as the official FINAO Athlete Ambassador. Melissa’s motivational seminars and workshops will Unleash The Athlete Within and teach you how Fuel The Athlete Within through optimal nutrition.\r\nThere is no doubt Melissa is the true definition of Fitlicious.\r\n', 'saved', '101-819474967IMG_7921.JPG', 'tempbg-101-667746885-', null);
INSERT INTO `fn_user_profile` VALUES ('45', '100', 'I made the commitment to live life intentionally and to convert my reckless poor choices into recklessly pursuing my dreams.', 'Lincoln NE', '100-MSsmprofile.jpg', '100-promo-9sm.jpg', '1', '100', '2013-04-09 11:02:02', '100', '2013-04-15 13:37:58', 'I am a professional, inspirational speaker based out of Lincoln, NE. I specialize in speaking to students and professionals about topics like bullying, leadership, and pursuing passions.', 'saved', null, null, null);
