INSERT INTO `fn_user_profile` VALUES ('117', '255', null, null, '255-11066008917190899.jpg', '255-2105762876-floorpose.jpg', '0', '255', '2013-06-21 10:59:23', '255', '2013-07-09 17:34:28', 'Beats in my head! Beats in my head! For the last 13 years I have aspired to live my dance in the rhythm of life. Music moves my soul and rhythm grooves my body. I currently travel across the country as a professional speaker and dance artist who helps others breakthrough their challenges and break free from their excuses.I was the first on my dad\'s side of the family to earn a college degree (University of Texas El Paso). I am proud of my Latino roots,er,I mean MEXICAN roots:) I\'ve danced in 3 countries to over 250,000 people. My books \"Mad Skills for Student Success\" and \"Bully Breakthrough\" help teens embrace awesomeness and live loud.\r\n\r\nI am honored to be part of the FINAO family. \r\n\r\nKeep On Dancing!', 'saved', '255-11066008917190899.jpg', 'tempbg-255-2105762876-floorpose.jpg', null);
INSERT INTO `fn_user_profile` VALUES ('118', '256', null, null, '256-1501418685eddieslowikowski-475x475.jpg', '256-2099280856-red.curtain.RIGHT_.microphone.jpg', '0', '256', '2013-06-21 15:34:04', '256', '2013-07-10 16:08:42', 'My name is Eddie Slowikowski and I have been a professional speaker for over two decades specializing in leadership and empowerment.  \r\n\r\nMy road to this career was paved by many miles as a professional runner.  I ran for NIKE & REEBOK and most notably for the United States Track and Field team.  I was fortunate enough to win a GOLD MEDAL for the US Track and Field team for the one mile run back in 1990 competing against the UK & Russia.  I have a personal best time of 3:58.62 for the one mile run! I am a 3x Division 1 NCAA All-American in both track and cross country for Loyola University Chicago.  Finally, I also worked as a reporter for CNN\'s Chicago bureau before beginning my career as a speaker back in the fall of 1991.  \r\n\r\nAs a professional speaker, I\'ve had the honor of presenting in 49 of 50 states as well as 5 different countries. I have dedicated my life to empowering others with the knowledge and life skills they need to create a compelling, adventurous and successful life.  Most importantly though, I am a proud father! My son Jack and daughter Gracie are the light of my existence and without a doubt the best part of who I am!  \r\n\r\nOne thing I have learned along the way - Failure Is Not An Option!  FINAO is more then a social media site, it is an ideology and a way of life! I am so excited to be a part of FINAO!', 'saved', '256-1501418685eddieslowikowski-475x475.jpg', 'tempbg-256-2099280856-red.curtain.RIGHT_.microphone.jpg', null);
