INSERT INTO `fn_user_profile` VALUES ('144', '296', null, null, '296-1151029433IMG_0592.JPG', '296-2114456375-WGHSslidereduced.002.jpg', '0', '296', '2013-07-07 15:12:43', '296', '2013-09-02 09:24:00', 'I\'m committed to Changing Lives & Impacting Futures! I am a school culture & climate consultant and I enjoy watching students, teachers, and schools become better today than yesterday.  My job is to provide thoughts, ideas, and strategies to assist with their FINAOs. Go out and be the World\'s Greatest version of yourself!', 'saved', '296-1151029433IMG_0592.JPG', 'tempbg-296-2114456375-WGHSslidereduced.002.jpg', null);
