INSERT INTO `fn_user_profile` VALUES ('148', '302', null, null, '302-69385269White_Square_Head.jpg', null, '0', '302', '2013-07-10 11:43:14', '302', '2013-07-10 11:46:52', 'Dr. Guy E. White is the founder of Exiting the Bakesale®, the revolutionary fundraising system for schools wanting to raise money without selling wrapping paper and cookie dough. Guy’s books, videos, products, online trainings, coaching and appearances inspire those he serves throughout the world. For these works, those he serves recognize him as providing life shifting, in-depth development programs for educators. Guy holds the highest level of teacher certification available in the United States. He is a Certified Integral Coach™ by Integral Coaching Canada. Guy has “gold standard” accreditations in the teaching and coaching fields respectively. Guy has contributed to Leadership in Student Activities magazine published by the National Association of Secondary School Principals for members of the National Association of Student Councils, the National Honor Society, and the National Junior Honor Society. His research, carried in Proquest Research Database, on Activities Directors of highly successful secondary schools is one of the most recent and comprehensive bodies of research on high school co-curricular activities programs in the world. Integral Coach™ is a registered trademark in Canada owned by Integral Coaching Canada Inc. and licensed to Guy E. White.', 'saved', '302-69385269White_Square_Head.jpg', null, null);
