INSERT INTO `fn_user_profile` VALUES ('204', '371', null, null, '371-1544270323me9.jpg', '371-1199629840-PeteAlderson_slotcouloirskiing01copy.jpg', '0', '371', '2013-08-23 20:03:01', '371', '2013-11-05 16:42:56', 'As a long time entrepreneur, I\'m lucky enough to be a FINAO employee. We don\'t do a lot of marketing at around here, but when we do it will probably have my fingerprints on it. Joining FINAO fulfilled my dream of working for a company that is doing really good things in the world. In my free time, I\'m kind of a mountain boy. I enjoy hiking, mountain climbing, and backcountry skiing (were there are no ski lifts, so you have to \"earn your turns\"). I also turned this personal passion into a way of giving back. I\'m the Vice Chairman and a Team Leader of Seattle Mountain Rescue. I also like to read, travel, and learn and discover new things. I\'m a student for life.', 'saved', '371-523489724ToddVanity.JPG', 'tempbg-371-1199629840-PeteAlderson_slotcouloirskiing01copy.jpg', null);
