INSERT INTO `fn_user_profile` VALUES ('312', '619', null, null, '619-584349888IMG_0167.JPG', '619-1642405904-IMG_6513.JPG', '0', '619', '2013-10-09 11:05:56', '619', '2013-10-09 11:43:30', 'I am Emily and Sam Burke\'s Mom and married to a fabulous guy named Cory.  I am a former Anheuser-Busch wholesaler (Owner/Exec. VP) I currently do contract work in Government Affairs and Public Relations.  I serve on AAA Washington\'s Corporate Board of Trustees, and am the Chairman of the Board of Trustees for Everett Community College.  I also serve on the Snohomish Boys and Girls Clubs Board of Trustees, a member of the S. Everett/Mukilteo Rotary Club, and serve of the Capitol Campaign for Snohomish County Domestic Violence Services.\r\n\r\nI am passionate about my family, my faith, making a positive difference in my community, and my friends.  I also LOVE to water and snow ski and enjoy other outdoor recreation like riding sand rails, quads and biking.    ', 'saved', '619-584349888IMG_0167.JPG', 'tempbg-619-1642405904-IMG_6513.JPG', null);
