INSERT INTO `fn_user_profile` VALUES ('326', '642', null, null, null, null, '0', '642', '2013-10-14 14:36:51', '642', '2013-10-14 14:36:51', 'My name is Daris Thomas. I am from Dorchester County, South Carolina (which is next to Charleston County, South Carolina). I am a proud native of the state of South Carolina and my dream career goal is to be a federal appeals judge on the United States Court of Appeals for the Fourth Circuit in Richmond, Virginia.\r\n       I am majoring in political science with a concentration in international relations, and I am writing my senior paper entitled \"The Admission of Puerto Rico to the United States of America\". My service-learning hours have all circled around my academic majors in political science and international relations. I have worked as a service-learning student for a legislative advocacy campaign, City Year Columbia, Kendall Curley & Associates (a private political consulting firm), and as a student assistant for Educational Support Services of Benedict College. This year, I am seeking to work as a service-learning volunteer for the South Carolina Democratic Party and the Neighborhood Assistance Corporation of America.\r\n       My dream career goal is to be an associate justice of the United States Supreme Court, and the first African-American judge from South Carolina elected and nominated to the nation\'s highest court. Before working as a judge in South Carolina, I want to gain some experience as a government attorney in South Carolina. For example, I want to work as either an assistant attorney general of South Carolina or an assistant United States Attorney for District of South Carolina for a few years after clerking for a United States Supreme Court justice. Then after working as a prosecutor, I want to work in the private sector focusing on corporate and securities litigation, business litigation, bankruptcy, tax, and estate planning and probate. I also want to run for a position as a judge in South Carolina on the Circuit Court, the Supreme Court and the 4th Circuit Court of Appeals.', 'saved', null, null, null);
