INSERT INTO `fn_user_profile` VALUES ('337', '673', null, null, '673-2065387731CARELOGO.png', '673-619569911-carecover.png', '0', '673', '2013-10-17 13:50:48', '673', '2013-10-17 14:13:55', 'The California Association of Renaissance Educators (CARE) was establish in 1996 by a group of passionate educators and Jostens® Sales Representatives who believed in the 10 Essential Elements. They came together as a means to teach the 10 Essential Elements and provide regional gatherings for Students, Educators, Parents, and Business leaders to exchange ideas, learn implementation strategies, and share their passion for excellence. CARE’s intent is to provide a re-charge and support the teaching of the Jostens® National Renassiance® Conference so more can experience the energy and excitement generated by these conferences.\r\n\r\nThe purpose of CARE is to provide workshops, training sessions, insight, and information for the implementation and enhancement of Jostens® Renaissance®. We believe all students have FUTURES and our goal is to support schools in their quest to Respect, Reward, Recognize, and Reinforce all stakeholders in their journey to achieve excellent results in being better today than yesterday.', 'saved', '673-2065387731CARELOGO.png', 'tempbg-673-619569911-carecover.png', null);
